// EventForm.js

import React, { useState } from 'react';

const EventForm = ({ onAddEvent }) => {
  const [id, setId] = useState('');
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [image, setImage] = useState(null); // State to hold the image file
  const [date, setDate] = useState('');
  const [hour, setHour] = useState('');
  const [address, setAddress] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    const newEvent = {
      id,
      title,
      description,
      imageUrl: URL.createObjectURL(image), // Use URL.createObjectURL to display the uploaded image
      date,
      hour,
      address,
    };
    onAddEvent(newEvent);
  };

  return (
    <>
      <nav className="bg-gray-800 py-4">
        <div className="container mx-auto flex justify-between items-center">
          <div className="text-white font-bold">Even <span className="text-yellow-500">D</span>ango</div>
          <ul className="flex space-x-4">
            <li><a href="/home" className="text-white  hover:text-yellow-500">Home</a></li>
            <li><a href="/home" className="text-white  hover:text-yellow-500">Create</a></li>
            <li><a href="/home" className="text-white  hover:text-yellow-500">Profile</a></li>
            <li><a href="/about" className="text-white  hover:text-yellow-500">About</a></li>
            <li><a href="#" className="text-white  hover:text-yellow-500">Contact</a></li>
          </ul>
        </div>
      </nav>
      <div className="flex justify-center items-center h-screen bg-gray-100">
        <div className="w-full max-w-md">
          <form onSubmit={handleSubmit} className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
            <div className="mb-4">
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="id">
                ID
              </label>
              <input
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                id="id"
                type="text"
                placeholder="ID"
                value={id}
                onChange={(e) => setId(e.target.value)}
              />
            </div>
            {/* Other input fields */}
            <div className="mb-4">
              <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="image">
                Image
              </label>
              <input
                className="hidden"
                id="image"
                type="file"
                accept="image/*"
                onChange={(e) => setImage(e.target.files[0])}
              />
              <label
                htmlFor="image"
                className="cursor-pointer bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              >
                Upload Image
              </label>
              {image && (
                <img
                  src={URL.createObjectURL(image)}
                  alt="Uploaded"
                  className="mt-2 rounded"
                  style={{ maxWidth: '100%', maxHeight: '200px' }}
                />
              )}
            </div>
            {/* Submit button */}
            <button
              className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              type="submit"
            >
              Create Event
            </button>
          </form>
        </div>
      </div>
    </>
  );
};

export default EventForm;
